import React from "react";
import "./MenuItemWithDropdown.css";

function MenuItemWithDropdown({
  title,
  dropdownItems = [],
  isActive,
  onDropdownClick,
  type = "button",
  link,
  onClick,
}) {
  return (
    <li className="li-button">
      {type === "link" ? (
        <a href={link} onClick={onClick}>
          {title}
        </a>
      ) : (
        <button onClick={onDropdownClick}>{title}</button>
      )}
      {isActive && (
        <ul className="ul-dropdown">
          {dropdownItems.map((item) => (
            <li key={item}>{item}</li>
          ))}
        </ul>
      )}
    </li>
  );
}

export default MenuItemWithDropdown;
